    false,nt"url": null,nt"notes": "Photos collected in marine turtle research
    programs are diverse, ranging from isolated observations of incidental encounters
    with turtles on the high-seas to voluminous, complex behavioral data gathered in
    systematic surveys of nesting beaches or inshore habitats. Due to the different
    types of photos, the information is opportunistically and periodically collected.
